import React, { Component } from 'react';
import Splash from '../Splash/Splash.jsx';
import UnsplashPhoto from "../UnsplashPhoto/UnsplashPhoto.jsx";
import AboutMe from "../AboutMe/AboutMe.jsx";
import Navbar from "../Navbar/Navbar.jsx"; 
import splashVideo from'../assets/splash-video-2.mp4';

class App extends Component {
  
  render() {
    return ( 
      <div>
        <Navbar links={[
          {href:"#page1",text:"Page 1"},
          {href:"#page2",text:"Page 2"},
          {href:"#pageN",text:"Page N"},
          {href:"#pageN+1",text:"Page N+1"}
          ]}
        />
        <Splash videoUrl={splashVideo} small="M" large="Michael"/>
        <UnsplashPhoto 
          author='Heather Shevlin' 
          photoSrc='https://images.unsplash.com/photo-1504988102213-007a5ff9d3fa?ixlib=rb-0.3.5&ixid=eyJhcHBfaWQiOjEyMDd9&s=220fad68d8a3ca3b2c3aa47aae6936a8'
          creditSrc="https://unsplash.com/@thehmstravels?utm_medium=referral&amp;utm_campaign=photographer-credit&amp;utm_content=creditBadge" target="_blank" rel="noopener noreferrer" title="Download free do whatever you want high-resolution photos"
        />
      </div>
    );
  }
}

export default App;
